import React from "react";
import "./nav.css";
const Nav = () => {
  return (
    <>
      <div className="nav-main">
        <div className="img"></div>
        <ul>
          <li>Home ⇂</li>
          <li>About ⇂</li>
          <li>Services ⇂</li>
          <li>Blog ⇂</li>
          <li>Contact</li>
        </ul>
      </div>
    </>
  );
};

export default Nav;
